let someNumber = 20;
let otherNumber = 10;
if (someNumber < otherNumber) {
    console.log(`El valor ${someNumber} es menor que ${otherNumber}`);
}
else {
    console.log(`El valor ${someNumber} es mayor que ${otherNumber}`);
}
